import React from "react";
import"./style.css";

const BookContainer = (props) => {
    return  (
        <div className="book-container">
            <div className="book-container__header-wrapper">
                <h2 className="book-container__header-title">Results</h2>
                <div className="dropdown-menu">
                    <button className="dropdown__btn">Sort</button>
                    <div className="dropdown__content">
                        <button className>Author</button>
                        <button>Title</button>
                    </div>
                </div>
            </div>
            <div className="book-container__header-rule" />
            {props.children}
            <button className="btn-view">View More <div className="btn-view__down-arrow"/></button>
        </div>
    );
}

export default BookContainer;
